        "content": {
            "text": "4.2.2 Interpreting Delay.  Managing delay online. Some delay is inherent to all interpreting - moving between ASL and English is a process that takes time - but signers and interpreter participants explained that this delay was particularly difcult to manage online. TERP12 explained that traditionally, “when we’re interpreting, we’re still back at point B, and they’ve gone on to point C. And so there would be that kind of like that nudge or that reminder to the teacher or whoever was speaking to just say, ‘OK, give me some time. I’m getting caught up with that point.”’  Interpretation is an iterative process; speakers need to be aware of the pace of interpretation and interpreters often ask signers to clarify their intent. However, this back and forth becomes difcult on VCs: TERP9 explained that “it’s harder to ask for clarifcation, like, can you go back? Sometimes, they don’t see me or can’t see me, and so they don’t see that request for clarifcation.” Difculty interjecting on VC. Interpretation delay is partic-ularly noticeable for signers when conversation participants are taking turns – D4 explained: “I’m thinking about what the person said, then another person has already said something or has already begun speaking. The interpreter has continued to interpret what the other person is saying, while I’m still contemplating what I just heard or saw”. While this makes joining conversations difcult regardless of environment, an increase in interpreter delay online amplifes this struggle. D1 shared that “my interpreter’s all ready to answer the question or to interpret the answer that I’ve given, but then somebody else has overstepped them and is answering the question, because there’s a little bit of a delay there.”  Furthermore, online conversation norms create particular considerations for interpreters. TERP9 de-scribed how it can be “a challenge of how to interrupt appropriately, then at the same time, understand the signed utterance, and then interrupt at the right moment,”  and that she often encountered the attitude that “this is not the time for interruptions, which just really feels oppressive to the Deaf person.”  Echoing this, some interpreters feel “less inclined to interrupt for clarifcation in a digital medium [...] like interrupting kind of disrupts the whole thing”  (TERP8). VC communication norms do not anticipate that some participants will be joining via interpreters, and delay in the interpretation process makes it harder for signers to communicate and interject. "
        },
