        "content": {
            "text": "4.2.1 Geting Atention without Audio.  Both d/Deaf signers and ASL interpreters face various challenges when they are trying to get the attention of other signers on VC platforms because existing platforms are designed to identify participation through audio. Impact  of  audio-centric  platforms.  Signers  described  how audio-centric VC platforms make it particularly difcult for d/Deaf people  to  get  others’  attention  and  to  identify  when  others  are trying to get their attention. D5 explained this issue: “hearing people just hear something and they are able to recognize that something’s [or someone’s] getting their attention”, however, “deaf people don’t have a similar access”. To compensate for this inequitable access, D16 has to perpetually “hunt and peck through the sea of faces”  to avoid overlooking when someone is “trying to get [his] attention”. This is amplifed by the fact that VCs do not automatically identify active signers, which can cause interpreters to unintentionally overlook signers. D2 emphasized the importance of getting the attention of interpreters before signing: “sometimes I’ll just be signing along and it’s dead silent in the room...someone will talk and say, did you just say something?... And then the interpreter’s like, ‘oh I’m sorry. I couldn’t see the comment. I’m so sorry.’ And that’s embarrassing. So I don’t like that. That can be a little traumatizing.” "
        },
