            "text": "groups of video feeds. D16 imagined a private group of signers and interpreters “pinned or tethered together”  so that if screens are rearranged, “the interpreter moves with me [...] instead of getting lost in the shufe of screens”. Interpreter participants stressed that this could address a key problem for accommodation service providers, as they are often separated from their clients when they are sent to meeting ‘breakout rooms’. In both co-design sessions with in-terpreter participants, they expressed an overwhelming interest to automatically have a clear sightline of signers, where “[signers’] videos will come up rather than me having to search for each person” (TERP10). Some participants wanted interpreter teams to be con-nected to signers’ video feeds so that interpreter switches could happen with less information loss. "
