            "text": "Information gaps. Participants further highlighted how the delay  in  locating  signers  or  interpreters  made  their  interpreter-mediated conversation less accessible. TERP108 found herself “miss-ing information” that should have been interpreted for/to the signer. Many d/Deaf signers like D2 rely heavily on a clear view of their interpreters to communicate, but often must “scroll through a whole gallery page of postage stamp sized cameras to fnd [interpreters]”, to then manually prioritize interpreter’s thumbnails using features such as the ‘pin’ option on Zoom. This can be particularly chal-lenging when team interpreters switch - delays in locating the ‘on’ interpreter often result in information gaps. When team interpreters 7 Identifer ‘D’ is used to refer to participants who identify as deaf or Deaf (d/Deaf ) 8 Identifer ‘TERP’ is used to refer to participants who are ASL interpreters turn take and switch, D5 explained that, “[interpreters] usually will sign some signal to let me know that I need to look from one inter-preter to the next.”  However, even with a preemptive notifcation, D2 described how she has to juggle locating the other interpreter’s thumbnail and navigating the switch; “I have to kind of be quick on that because I don’t want to miss any of the information”. Workaround attempts. Though some participants (6 of 12 par-ticipants) found workarounds to minimize information gaps useful, others described some of these workarounds, such as multi-pinning “the interpreter and the instructor at the same time”  (D3) as tempo-rary band-aids. For example, in the classes TERP13 interprets for, screen sharing “cancels out those two (pinned) videos and then just makes your whole screen full screen of whatever they’re showing”. D2 commented that signers and their interpreters still require some adjustment time to “do that little dance”  and reconfgure the pins again. Like many participants, D1 uses multiple monitors to move “back and forth”  between interpreters’ videos on one side and other content (e.g., meeting notes) on another. In his coding classes, D1 feels behind because when his teacher “does some coding, [he has] to look at [his] interpreter, so [he] miss[es] it”. Participants, like D4, often like to “look at the person who’s making a comment or asking a question, [their] body language, facial expressions, and those sorts of things”  to understand communication context and to take in the various NMMs9  that are critical to ASL conversations. However, D4 explained that online visual dispersion forces her to make tradeofs: “When I look at that person, then I miss the next part of the interpreted message because I’m not looking at the interpreter at that moment.” The workarounds described by participants interfered with their ability to have efective signed conversations over VCs, as they continued to miss out on signs and NMMs.. "
