            "text": "Our analysis identifed accessibility barriers in VC use for signers and interpreters related to: (1) consuming information, (2) communi-cating, (3) collaborating, and (4) hosting meetings over VC platforms. Informed by the qualitative accounts and co-design sessions, we also highlight specifc design opportunities to make commercially used VC platforms more accessible for signers. We occasionally name specifc platforms mentioned by participants, but none of these mentions constitute an endorsement. We have also consolidated our design considerations into a list of signer-inclusive VC design requirements, tailored for platform designers, which is available in our Supplementary Materials. "
