        "content": {
            "text": "3.1 Remote Study Protocol Design We iteratively designed our protocol based on six pilot sessions with 10 pilot participants. Content from the pilot sessions is not included in our fndings. Beginning with the pilot studies, and con-tinuing throughout the entire research process, we adopted a critical refective perspective [20, 23, 70] by journaling and conducting ret-rospective discussions to document and resolve the accessibility issues that signers and researchers faced. To ensure consistency and familiarity with the nuances of the research, two ASL interpreters, certifed by Registry of Interpreters for the Deaf, Inc. (RID), were hired as the designated interpreters to interpret for all sessions (including the pilots), hereafter referred to as research interpreters. Both research interpreters are highly qualifed, and had an estab-lished working relationship with the Deaf co-frst author. One has been interpreting for over 30 years and the other is both an experi-enced researcher and interpreter. Our initial three pilot studies (two interviews, one co-design ses-sion with three signers) provided a preliminary understanding of access issues within our protocols. During each session, researchers created feld notes of their observations and participants’ feedback, and sessions were followed by a 30-minute refective debrief with the research team (one Deaf researcher who primarily communi-cates in ASL, one hearing researcher, and two research interpreters). These debriefs guided protocol iteration based on challenges during the pilots (e.g., having a researcher sketch participant ideas rather than having participants juggle between signing and using Figma). To  validate  and  fne-tune  our  updated  protocols  we  conducted three more pilot studies (two interviews, with a d/Deaf signer and interpreter,  and  one  codesign  session  with  three  DHH  signers), continuing to debrief and iterate until we felt confdent that our protocol would allow the most accessible study we could conduct given the environmental constraints of remote research. We fur-ther detail protocol iterations in following subsections (Formative Interviews, and Co-design Workshops). "
        },
