        "content": {
            "text": "Despite DHH people’s diverse video communication needs, most prior  work  [16,  38,  42]  does  not  specifcally  target  signers,  de-spite  the  fact  that  the  key  elements  of  ASL  (handshape,  move-ment, sign location, orientation and non-manual behaviors) gener-ate unique requirements for inclusive interaction experience design [15, 25, 43, 49]. While prior HCI and CSCW studies have explored video communication in ASL, much has focused on automated ASL recognition [13, 40, 73], animation [1, 33, 35], and classroom use [16, 41], with a very limited understanding of real-time computer-mediated ASL communication through interpreters [17, 49]. Addi-tionally, while some work has explored the experiences of inter-preters who work for Video Relay Service (VRS) or Video Remote Interpreting (VRI2) providers [60, 71], less is known about freelance community ASL interpreters’ use of VC, who traditionally work in person and do not have formal remote interpreting support. In response to the exponential increase in use of desktop-based VC platforms during the COVID pandemic, we focus on specifc consid-erations that signers face in this unique context, providing the frst qualitative accounts of both d/Deaf3  signers and ASL community interpreters’ use of and design preferences for videoconferencing. "
        },
