            "text": "Throughout most of the United States and Canada, American Sign Language (ASL) is the Deaf community’s primary language. As an independent visual-spatial language, ASL has its own distinct grammatical rules and consists of a sequence of handshapes, lo-cations, palm orientation, and non-manual markers (NMM) and movements [24, 49, 74, 77]. NMMs include visual-facial gestural expressions, head tilting, eye shifting and body positioning, and provide critical additional grammatical context to manual signs in ASL conversation. A common example of NMM use is furrowing one’s eyebrows and doing a slight backwards head tilt to indicate that signed WH- words (e.g., who, what, when, where, why) are being  used  to  ask  a  question  [80,  85].  Additionally,  signers  rely on solely non-verbal backchannel feedback, a linguistic phenome-non wherein people signal their understanding, active attention, and dis/agreement to speakers without taking the communicative foor [30, 63, 77]. Spoken languages use both non-verbal (e.g., low-ered eyebrows to indicate confusion) and verbal (e.g., “mmhmm”, “yeah”) backchannelling, and hearing communicators can multitask, attending to the spoken content of a conversation alongside visual and non-visual backchannel feedback. Deaf signers, on the other hand, can only attend to communication in their line of sight and therefore require particular conversational environments to be able to follow both a conversation and backchannel feedback. Further, the use of eye gaze is critical in ASL as it is a key element of many grammatical structures such as verb agreement [76]. ASL commu-nication relies on many parts of the body, including handshapes, facial expressions, and body movements, and rendering this rich visual information online creates unique considerations. While the hearing world often considers deafness to be a type of disability, many Deaf people instead see deafness as a cultural iden-tity, akin to an ethnicity [34, 45]. ASL is central to Deaf culture and identity, operating not just as a preferred communication modality but as a site of community formation [45]. Deaf studies scholar Tom Humphries coined the term “audism” to describe the systemic discrimination where “one is superior based on one’s ability to hear or behave in the manner of one who hears” [8, 45, 74]. While many DHH signers fall back on texting or captioning to communicate with others, prior work argues that an overemphasis on text-based modalities in technology development perpetuates audist biases that push DHH signers to conform with spoken and written Eng-lish rather than respecting their preference for sign [8, 49]. This manifestation of audism can place the burden on DHH users to "
